import React, { useState, useEffect } from 'react';
import axios from 'axios';

function DataFetching() {
  const [posts, setPost] = useState([]);
  useEffect(() => {
    axios
      .get(
        'https://cors-anywhere.herokuapp.com/https://localhost:7275/Client/GetAllClients',
      )
      .then((res) => {
        console.log(res);
        setPost(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  });
  return (
    <div>
      <ul>
        {posts.map((post) => {
          <li key={post.ClientId}>{post.FirstName}</li>;
        })}
      </ul>
    </div>
  );
}

export default DataFetching;
